void Block_codeRepl116_pr::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_done_reg = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, ap_continue.read())) {
            ap_done_reg = ap_const_logic_0;
        } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state256.read()) && 
                    !(esl_seteq<1,1,1>(ap_const_logic_0, data_IN_M_real_TVALID_int.read()) || esl_seteq<1,1,1>(ap_const_logic_0, data_IN_M_imag_TVALID_int.read())))) {
            ap_done_reg = ap_const_logic_1;
        }
    }
}

